import { Container, Content, MenuLogin, MenuBtn } from './styles';

export function LoginPage() {
  return (
    <Container>
      <Content>
        <img src="save-the-date/src/assets/profile-lite.svg" alt="" />
        <MenuLogin>
          <MenuBtn type="button">Nome completo</MenuBtn>
          <MenuBtn type="button">E-mail</MenuBtn>
          <MenuBtn type="button">Data de nascimento</MenuBtn>
          <MenuBtn type="button">Telefone</MenuBtn>
          <MenuBtn type="button">Senha</MenuBtn>
          <MenuBtn type="button">Confirme sua senha</MenuBtn>
        </MenuLogin>
      </Content>
    </Container>
  );
}
